import './App.css';


function App() {
  return (
    <div className="App">
      <div className='container mx-auto'>
         <div className='navbar w-fit bg-slate-700 p-5 h-auto'>
          <ul className='flex text-white p-3'>
            <li>home</li>
            <li>about</li>
            <li>product</li>
            <li>career</li>
            <li>contact</li>
          </ul>
         </div>
      </div>
    </div>
  );
}

export default App;
